//이미지 생성 버튼 클릭 시
generateBtn.addEventListener('click', () => {
    if (!selectedTag) {
        alert('태그를 선택하세요');
        return;
    }
    // 이미지를 생성하기 전에 기존 이미지가 있으면 제거
    if (imageContainer.firstChild) {
        imageContainer.removeChild(imageContainer.firstChild);
    }

    const keyword = selectedTag.slice(1); // 선택된 태그의 '#' 기호를 제외.
    const randomNumber = Math.floor(Math.random() * 15);
    const imgUrl = imageUrls[keyword][randomNumber];

    const img = document.createElement('img');
    img.src = imgUrl;

    img.style.display = 'block'; // 이미지를 블록 요소로 설정하여 가운데 정렬이 적용되도록 함
    img.style.margin = 'auto'; // 이미지를 가운데 정렬

    imageContainer.appendChild(img);
});

//태그 버튼들 클릭 시
tagButtons.forEach(button => {
    button.addEventListener('click', () => {
        selectedTag = button.textContent;
        if (tagNameContainer.firstChild) {
            tagNameContainer.removeChild(tagNameContainer.firstChild);
        }
        // 클릭된 버튼의 텍스트 콘텐츠를 가져와서 색상 태그로 추가합니다.
        const tagText = button.textContent;
        const tagElement = document.createElement('span');
        
        // 새로운 색상 태그에 스타일을 적용합니다.
        tagElement.textContent = tagText;
        tagElement.style.color = 'black';
        tagElement.style.marginRight = '5px'; // 색상 태그 사이에 간격을 줍니다.
        
        // 색상 태그를 tagNameContainer에 추가합니다.
        tagNameContainer.appendChild(tagElement);
    });
});

//저장 버튼 클릭 시
saveBtn.addEventListener('click', () => {
    if (!selectedTag) {
        alert('태그를 선택하세요');
        return;
    }
     
    // 이미지 요소 가져오기
    const imgElement = document.querySelector("#imageContainer img");

    //HTML2Canvas 이용해 이미지 캡처
    html2canvas(imgElement, {
        allowTaint: true,
        useCORS: true,
    }).then(canvas => {
        
        // 캡처된 이미지를 데이터 URL로 변환합니다.
        const imageDataURL = canvas.toDataURL('image/jpeg');

        // 다운로드 링크 생성 및 클릭 이벤트 발생
        const link = document.createElement('a');
        link.href = imageDataURL;
        link.download = 'gaemseongThumbnail.jpg'; // 다운로드될 파일 이름 지정
        link.click();
    });
});